	cache = f77xml_Cache_instance();

	*o_err = ERR_NEVER_RETURN_THIS;
	*o_bool = true;

	str = f77xml_Cache_getDOMString(cache, *i_code, o_err);
	if (str == NULL) return;

	len = gdome_str_length(str);
	off = *i_offset;

	if (off >= len) off = len;

	f77xml_StringObj_set(o_string, str->str+off);

	if (f77xml_StringObj_size(o_string)+off < len) *o_bool = false;
	else *o_bool = true;

}

void f77xml__di_createDocFromURI(code *o_ret,
			code *i_di,
			StringObj *i_uri,
			unsigned int *i_mode,
			error *o_err) {

	GdomeDOMImplementation *di;
	GdomeDocument *doc;
	GdomeException exc;
	Cache *cache;

	cache = f77xml_Cache_instance();

	*o_err = ERR_NEVER_RETURN_THIS;
	*o_ret = NullCode;

	di = f77xml_Cache_getDOMImplementation(cache, *i_di, o_err);
	if (di == NULL) return;

	doc = gdome_di_createDocFromURI(di,i_uri->str,*i_mode,&exc);

	if (exc) {
		assert ( doc == NULL );
		*o_err = ERR_GDOME;
		return;
	}

	*o_err = ERR_NO_ERROR;
	*o_ret = f77xml_Cache_addDocument(cache, (gpointer)doc);

}

private void f77xml__doc_importNode(code *o_ret,
				code *i_code1,
				code *i_code2,
				bool *i_bool1,
				error *o_err) {

	/* {{{ OK */
	GdomeDocument *obj1;
	GdomeNode *obj2;
	GdomeNode *ret;
	GdomeException exc;

	Cache *cache = f77xml_Cache_instance();
	*o_err = ERR_NEVER_RETURN_THIS;

	obj1 = f77xml_Cache_getDocument(cache, *i_code1, o_err);
	if (obj1 == NULL) return;

	obj2 = f77xml_Cache_getNode(cache, *i_code2, o_err);
	if (obj2 == NULL) return;

	ret = gdome_doc_importNode(obj1,obj2,*i_bool1,&exc);

	if (exc) {
		assert (ret == NULL);
		*o_err = ERR_GDOME;
		return;
	}

	*o_err = ERR_NO_ERROR;

	if (ret == NULL) {
		*o_ret = NullCode;
		return;
	}

	*o_ret = f77xml_Cache_addNode(cache, (gpointer)ret);

	/* }}} */

}

static void f77xml__di_createDocument(code *o_ret,
			code *i_code1,
			code *i_code2,
			code *i_code3,
			code *i_code4,
			error *o_err) { 
	/* {{{ OK */
	GdomeDocument *ret;
	GdomeDOMImplementation *obj1;
	GdomeDOMString *obj2;
	GdomeDOMString *obj3;
	GdomeDocumentType *obj4;
	GdomeException exc;

	Cache *cache = f77xml_Cache_instance();

	*o_err = ERR_NEVER_RETURN_THIS;
	*o_ret = NullCode;

	obj1 = f77xml_Cache_getDOMImplementation(cache, *i_code1, o_err);
	if (obj1 == NULL) return;

	obj2 = f77xml_Cache_getDOMString(cache, *i_code2, o_err);
	if (obj2 == NULL) {
		if (*o_err != ERR_NULL_CODE) return;
		*o_err = ERR_NO_ERROR;
	}

	obj3 = f77xml_Cache_getDOMString(cache, *i_code3, o_err);
	if (obj3 == NULL) return;

	obj4 = f77xml_Cache_getDocumentType(cache, *i_code4, o_err);
	if (obj4 == NULL) {
		if (*o_err != ERR_NULL_CODE) return;
		*o_err = ERR_NO_ERROR;
	}

	ret = gdome_di_createDocument(obj1,obj2,obj3,obj4,&exc);

	if (exc) {
		assert (ret == NULL);
		*o_err = ERR_GDOME;
		return;
	}

	*o_err = ERR_NO_ERROR;

	if (ret == NULL) {
		*o_ret = NullCode;
		return;
	}

	*o_ret = f77xml_Cache_addDocument(cache, (gpointer)ret);

	/* }}} */

}

void f77xml__di_saveDocToFile(bool *o_ret,
			code *i_di,
			code *i_doc,
			StringObj *i_uri,
			unsigned int *i_mode,
			error *o_err) {
	/* {{{ */
	GdomeDOMImplementation *di;
	GdomeDocument *doc;
	GdomeException exc;
	Cache *cache;

	cache = f77xml_Cache_instance();

	*o_err = ERR_NEVER_RETURN_THIS;
	*o_ret = false;

	di = f77xml_Cache_getDOMImplementation(cache, *i_di, o_err);
	if (di == NULL) return;

	doc = f77xml_Cache_getDocument(cache, *i_doc, o_err);
	if (doc == NULL) return;

	*o_ret = gdome_di_saveDocToFile(di,doc,i_uri->str,*i_mode,&exc);

	if (exc) {
		*o_err = ERR_GDOME;
		return;
	}

	*o_err = ERR_NO_ERROR;
	/* }}} */
}

void f77xml__xpeval_evaluate(code *o_ret,
			code *i_eval,
			code *i_str,
			code *i_node,
			code *i_xpnsresolv,
			unsigned int *i_type,
			code *i_xpres,
			error *o_err) {
	/* {{{ */ 
	GdomeXPathResult *ret;
	GdomeXPathEvaluator *eval;
	GdomeDOMString *str;
	GdomeNode *node;
	GdomeXPathNSResolver *xpnsresolv;
	GdomeXPathResult *xpres;
	GdomeException exc;
	Cache *cache;

	cache = f77xml_Cache_instance();

	*o_err = ERR_NEVER_RETURN_THIS;
	*o_ret = NullCode;

	eval = f77xml_Cache_getXPathEvaluator(cache, *i_eval, o_err);
	if (eval == NULL) return;

	str = f77xml_Cache_getDOMString(cache, *i_str, o_err);
	if (str == NULL) return;

	node = f77xml_Cache_getNode(cache, *i_node, o_err);
	if (node == NULL) return;

	xpnsresolv = f77xml_Cache_getXPathNSResolver(cache, *i_xpnsresolv, o_err);
	if (xpnsresolv == NULL) {
		if (*o_err != ERR_NULL_CODE) return;
		*o_err = ERR_NO_ERROR;
	}

	xpres = f77xml_Cache_getXPathResult(cache, *i_xpres, o_err);
	if (xpres == NULL) {
		if (*o_err != ERR_NULL_CODE) return;
		*o_err = ERR_NO_ERROR;
	}

	ret = gdome_xpeval_evaluate(eval,str,node,xpnsresolv,*i_type,xpres,&exc);

	if (exc) {
		*o_err = ERR_GDOME;
		return;
	}

	*o_err = ERR_NO_ERROR;

	if (ret == NULL) {
		*o_ret = NullCode;
		return;
	}

	*o_ret = f77xml_Cache_addXPathResult(cache, (gpointer)ret);

	/* }}} */

}
